function WDGCampaignDashboard(){this.initWithHash(),this.initMenu()}WDGCampaignDashboard.prototype.initWithHash=function(){var i=window.location.hash.substring(1);""!==i&&this.switchTab(i)},WDGCampaignDashboard.prototype.initMenu=function(){var i=this;$("ul.nav-menu li a").each(function(){$(this).click(function(){i.switchTab($(this).data("tab"))})})},WDGCampaignDashboard.prototype.switchTab=function(i){$("ul.nav-menu li").removeClass("selected"),$("div#item-body > div.item-body-tab").hide(),$("ul.nav-menu li#menu-item-"+i).addClass("selected"),$("div#item-body > div#item-body-"+i).show()},$(function(){new WDGCampaignDashboard});